import React, { useState } from 'react';
import { DndProvider, useDrag, useDrop } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';
import './styles.css';

const App = () => {
  const [pageComponents, setPageComponents] = useState([]); // Array of components on the page

  const deleteComponent = (id) => {
    setPageComponents((prevComponents) => prevComponents.filter((comp) => comp.id !== id));
  };

  return (
    <DndProvider backend={HTML5Backend}>
      <div className="app">
        <Sidebar />
        <MainContent
          pageComponents={pageComponents}
          setPageComponents={setPageComponents}
          deleteComponent={deleteComponent}
        />
      </div>
    </DndProvider>
  );
};

// Sidebar with draggable items
const Sidebar = () => {
  const draggableComponents = [
    { id: 'text1', type: 'TEXT', content: 'This is a text block.' },
    { id: 'button', type: 'BUTTON', content: 'Click Me' },
    { id: 'link', type: 'LINK', content: 'Visit Levi\'s', url: 'https://www.levi.com' },
    { id: 'image', type: 'IMAGE', content: 'Image of Jeans', url: 'https://via.placeholder.com/150' },
    { id: 'video', type: 'VIDEO', content: 'Product Video', url: 'https://www.youtube.com/embed/dQw4w9WgXcQ' },
  ];

  return (
    <div className="sidebar">
      <h2>Sidebar</h2>
      {draggableComponents.map((item) => (
        <DraggableComponent key={item.id} item={item} />
      ))}
    </div>
  );
};

// Draggable component
const DraggableComponent = ({ item }) => {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: item.type,
    item,
    collect: (monitor) => ({
      isDragging: monitor.isDragging(),
    }),
  }));

  return (
    <div
      ref={drag}
      className="draggable-item"
      style={{ opacity: isDragging ? 0.5 : 1 }}
    >
      {item.content}
    </div>
  );
};

// Main content area where items will be dropped
const MainContent = ({ pageComponents, setPageComponents, deleteComponent }) => {
  const [{ canDrop, isOver }, drop] = useDrop(() => ({
    accept: ['TEXT', 'BUTTON', 'LINK', 'IMAGE', 'VIDEO'],
    drop: (item, monitor) => addComponent(item, monitor),
    collect: (monitor) => ({
      isOver: monitor.isOver(),
      canDrop: monitor.canDrop(),
    }),
  }));

  // Function to add a component
  const addComponent = (item, monitor) => {
    const { x, y } = monitor.getClientOffset(); // Get position where the item is dropped
    setPageComponents((prev) => [
      ...prev,
      { ...item, id: `${item.id}-${Date.now()}`, x, y },
    ]);
  };

  return (
    <div ref={drop} className="main-content">
      <h2>Main Content</h2>
      {pageComponents.map((component) => (
        <Component key={component.id} component={component} deleteComponent={deleteComponent} />
      ))}
    </div>
  );
};

// Component to render dropped items
const Component = ({ component, deleteComponent }) => {
  return (
    <div
      className="component"
      style={{
        left: `${component.x}px`,  // Set position based on x
        top: `${component.y}px`,   // Set position based on y
      }}
    >
      {component.type === 'TEXT' && <p>{component.content}</p>}
      {component.type === 'BUTTON' && <button>{component.content}</button>}
      {component.type === 'LINK' && <a href={component.url} target="_blank" rel="noopener noreferrer">{component.content}</a>}
      {component.type === 'IMAGE' && <img src={component.url} alt={component.content} />}
      {component.type === 'VIDEO' && <iframe src={component.url} title={component.content} width="300" height="200"></iframe>}
      <button className="delete-btn" onClick={() => deleteComponent(component.id)}>
        Delete
      </button>
    </div>
  );
};

export default App;
